import React from "react";
import styled from "styled-components";

const VideoBlock = styled.div`
  background-color: #dddddd;
  width: 858px;
  height: 477px;
  margin-left: 22.16%;
  margin-right: 8%;
`;
function AboutEcVideo() {
  return <VideoBlock></VideoBlock>;
}

export default AboutEcVideo;
